import React from 'react'
import styled from 'styled-components'


const HomePageRouter: React.FC = () => {


    return (
        <StyledSectionsHolder>
        <StyledSections accesskey="s" href="#" className="firstSection" >More About Me</StyledSections>
        <StyledSections accesskey="s" href="#" className="secondSection" >Past Projects</StyledSections>
        <StyledSections accesskey="s" href="#" className="thirdSection" >Tools, Libraries and Languages</StyledSections>
        <StyledSections accesskey="" href="#" className="fourthSection" >Past Dapp Information</StyledSections>
        </StyledSectionsHolder>
    )
}

const StyledSections = styled.a`
    height: 10%;
    width: 100%;
    padding:2%;
    display: flex;
    justify-content: center;
    align-items: center;
    text-decoration: none;
    font-size: 26px;
`
const StyledSectionsHolder = styled.div`
    height: 100%;
    width: 96%;
    display: flex;
    flex-direction: column;
`

export default HomePageRouter
